import { IItem, IRepository } from '../interfaces'

export class FakeRepository implements IRepository {

  data: IItem[] = data

  getChildren(itemId: string): Promise<IItem[]> {
    return new Promise<IItem[]>(
      resolve => {
        resolve(
          this.data.filter(
            (value: IItem) => {
              return value.Parent === itemId
            })
        )
      }
    )
  }
}

